import React from 'react';
import { makeStyles, withStyles } from '@material-ui/core/styles';
import Tabs from '@material-ui/core/Tabs';
import Tab from '@material-ui/core/Tab';
import Typography from '@material-ui/core/Typography';
import { FormattedMessage } from 'react-intl'; 
import PricesIroning from './PricesIroning';


const StyledTabs = withStyles({
  indicator: {
    display: 'flex',
    justifyContent: 'center',
    backgroundColor: 'transparent',
    '& > div': {
      maxWidth: 40,
      width: '100%',
      backgroundColor: '#635ee7',
    },
  },
})(props => <Tabs {...props} TabIndicatorProps={{ children: <div /> }} />);

const StyledTab = withStyles(theme => ({
  root: {
    textTransform: 'none',
    color: '#fff',
    fontWeight: theme.typography.fontWeightRegular,
    fontSize: theme.typography.pxToRem(15),
    marginRight: theme.spacing(1),
    '&:focus': {
      opacity: 1,
    },
  },
}))(props => <Tab disableRipple {...props} />);

const useStyles = makeStyles(theme => ({
  root: {
    flexGrow: 1,
  },
  padding: {
    padding: theme.spacing(2),
  },   
  demo2: {
    backgroundColor: '#0E1521',
  },
}));

export default function CustomizedTabs() {
  const classes = useStyles();
  const [value, setValue] = '0';

  function handleChange(event, newValue) {
    setValue(newValue);
  }

  return (
    <div className={classes.root}>
      <div className={classes.demo2}>
        <StyledTabs value={value} onChange={handleChange} aria-label="Styled tabs example" >
            <FormattedMessage id='prices.title1'>
              {label => (<StyledTab label={label}><div>allooooodfdfdsfsdfoooooooooooooooo</div></StyledTab>)}
            </FormattedMessage>
            <FormattedMessage id='prices.title2'>
              {label => (<StyledTab label={label} />)}
            </FormattedMessage>
            <FormattedMessage id='prices.title3'>
              {label => (<StyledTab label={label} />)}
            </FormattedMessage>
        </StyledTabs>
        <Typography className={classes.padding} />
      </div>
    </div>
  );
}
